// Imports
import React, { Component } from 'react';
import './userRanking.css';

import GreenArrow from '../img/greenarrow.png';
import RedArrow from '../img/redarrow.png';
import Dice from '../img/dice.png';

class UserRanking extends Component {
  render() {
    return (
      <div className='user_ranking' style={this.props.backgroundColor}>
        <p>{this.props.timeOfBet}</p>
        <p>{this.props.userName}</p>
        <p>{this.props.rollUnder}</p>
        <p>{this.props.betAmount}<span className='EOS_curr_light'>EOS</span></p>
        <p>{this.props.diceRoll}</p>
        <p>{this.props.payoutAmount}<span className='EOS_curr_light'>EOS</span></p>
      </div>
    );
  }
}

export default UserRanking;
